/// sonyLensTypes lookup table
pub static SONY_LENS_TYPES: LazyLock<HashMap<&str, &'static str>> =
    LazyLock::new(|| SONY_LENS_TYPES_DATA.iter().copied().collect());

/// Look up sonyLensTypes value by key
pub fn lookup_sony_lens_types(key: &str) -> Option<&'static str> {
    SONY_LENS_TYPES.get(&key).copied()
}
